function setEmailInputs(){$("input[type=email]").on("blur",function(){$(this).mailcheck({suggested:function(t,e){t.next().hasClass("email_suggestion")||t.after(create_emai_suggestion_link(t,e))},empty:function(){}})})}function create_emai_suggestion_link(t,e){return $("<a/>",{html:"Did you mean: <strong>"+e.full+"</strong>",style:"display: block","class":"email_suggestion"}).click(function(){$(t).val(e.full),this.remove()})}function set_request_count(){$.ajax({url:"/requests/count",type:"get",success:function(t){$("#request_count").html("Requests ("+t+")")},error:function(t){console.log(t)}})}function getPartialData(t,e,n,o){$.ajax({url:t,type:n,beforeSend:function(t){t.setRequestHeader("X-CSRF-Token",$('meta[name="csrf-token"]').attr("content"))},success:function(t){$(e).html(t)},error:function(t){$(e).html(t),console.log(t)},complete:function(){void 0!=o&&o()}})}$(function(){set_request_count(),$(".alert").alert()});